import { describe, expect, it } from 'vitest'
import { findTheDifference } from '../../code/easy/00389-Find-the-Difference'

describe('find the difference test case 🥇', () => {
  it('should return the expected result', () => {
    const s = 'abcd'
    const t = 'abcde'
    const result = findTheDifference(s, t)
    const expected = 'e'
    expect(result).toBe(expected)
  })
})

describe('find the difference test case 🥈', () => {
  it('should return the expected result', () => {
    const s = ''
    const t = 'y'
    const result = findTheDifference(s, t)
    const expected = 'y'
    expect(result).toBe(expected)
  })
})

